import React from 'react';
import './index.css';
import { useSelector } from 'react-redux';

function Spin({status}){
  const statusSpin = useSelector(state => state.status);

  console.log(statusSpin);
  return(
    <React.Fragment>
      <div className="spin-wrap">
        <div className="spin-container">
            <div className="spin-mohi">
              <span>Mohi</span>
            </div>
        </div>
      </div>
    </React.Fragment>
  )
}

export default Spin;
